document.addEventListener('DOMContentLoaded', function() {
    const signatureForm = document.getElementById('signatureForm');
    const signaturePreview = document.getElementById('signaturePreview');
    const copyHtmlBtn = document.getElementById('copyHtml');
    const downloadImageBtn = document.getElementById('downloadImage');
    const downloadTextBtn = document.getElementById('downloadText');

    // Generar la firma
    signatureForm.addEventListener('submit', function(e) {
        e.preventDefault();
        
        // Obtener valores del formulario
        const fullName = document.getElementById('fullName').value;
const position = document.getElementById('position').value;
        const officePhone = document.getElementById('officePhone').value;
        const email = document.getElementById('email').value;
        const personalPhone = document.getElementById('personalPhone').value;
        const officeAddress = document.getElementById('officeAddress').value;

        // Crear HTML de la firma
        
        let signatureHTML = `
    <div class="signature-container">
        <img class="imagenmod" src="data:image/png;base64," />
        
        <div class="signature-content">
            <div class="signature-name">${fullName}</div>
            <div class="signature-title">${position}</div>
            
            <div class="signature-contact">
                ${officeAddress ? `<div>${officeAddress}</div>` : ''}
                <div>${officePhone}${personalPhone ? ` / ${personalPhone}` : ''}</div>
                <div>${email}</div>
                <div><a href="https://wradio.com.co" class="signature-website">wradio.com.co</a></div>
            </div>
            
            <div class="confidential">
                Este correo y sus anexos son confidenciales.
            </div>
        </div>
    </div>
`;

        // Mostrar vista previa
        signaturePreview.innerHTML = signatureHTML;
    });

    // Copiar HTML de la firma
    copyHtmlBtn.addEventListener('click', function() {
        if (signaturePreview.innerHTML.includes('text-muted')) {
            alert('Primero genera una firma');
            return;
        }
        
        const htmlToCopy = signaturePreview.innerHTML;
        navigator.clipboard.writeText(htmlToCopy)
            .then(() => {
                alert('HTML copiado al portapapeles');
            })
            .catch(err => {
                console.error('Error al copiar: ', err);
                alert('Error al copiar el HTML');
            });
    });

    // Descargar como imagen
    // Descargar como imagen - Versión mejorada
    downloadImageBtn.addEventListener('click', async function() {
        if (signaturePreview.innerHTML.includes('text-muted')) {
            alert('Primero genera una firma');
            return;
        }
        
        try {
            // Mostrar estado de carga
            downloadImageBtn.innerHTML = '<i class="fas fa-spinner fa-spin me-2"></i>Generando...';
            downloadImageBtn.disabled = true;
            
            // Obtener nombre para el archivo
            const fullName = document.getElementById('fullName').value || 'firma';
            const fileName = `firma_${fullName.toLowerCase().replace(/\s+/g, '_')}.png`;
            
            // Configuración especial para html2canvas
            const options = {
                scale: 2, // Mejor calidad
                logging: true, // Para ver detalles en consola
                useCORS: true, // Permite imágenes cruzadas
                allowTaint: true, // Permite imágenes no CORS
                backgroundColor: '#ffffff' // Fondo blanco
            };
            
            // Crear un clon del elemento para evitar problemas
            const clone = signaturePreview.cloneNode(true);
            clone.style.position = 'absolute';
            clone.style.left = '-9999px';
            document.body.appendChild(clone);
            
            // Generar la imagen
            const canvas = await html2canvas(clone, options);
            
            // Crear enlace de descarga
            const link = document.createElement('a');
            link.download = fileName;
            link.href = canvas.toDataURL('image/png');
            link.click();
            
            // Limpiar
            document.body.removeChild(clone);
            
        } catch (error) {
            console.error('Error detallado:', error);
            alert('Error: ' + error.message);
        } finally {
            // Restaurar botón
            downloadImageBtn.innerHTML = '<i class="fas fa-download me-2"></i>Descargar Imagen';
            downloadImageBtn.disabled = false;
        }
    });
    
});